import renderIndexMenu from '../searchList/renderIndexMenu';
import ProfileListItem from "../searchList/profileListItem"
import * as style from "../../css/light/searchList";
import totalToRender from "./totalToRender"

export default function ProfileList({listToRender, profileDataToRender, setProfileDataToRender, totalToRenderNumber}) {
  const renderList = profileDataToRender => {
    console.log(totalToRender(profileDataToRender, totalToRenderNumber))

    return totalToRender(profileDataToRender).map((item, i) => (
      <a
          key={`ListItem${i}`}
          href={item.link}
          target="_blank"
          rel="noreferrer"
          style={{textDecoration: "none", color: "inherit"}}
      >
        <ProfileListItem key={`ListItem${i}`} data={item}/>
      </a>
    ))
  }

  const renderListContainer = () => {
    return listToRender.map((listName, i) => (
      <div key={`ListContainer${i}`}>
        {/* {renderIndexMenu(props.data, props.item, props.filteredSearch, profile)} */}
        {renderList(profileDataToRender[listName.toLowerCase()])}
      </div>
    ))
  }

  return (
    <div style={style.listContainerStyle}>
      {renderListContainer()}
    </div>
  )
}
